import { defineStore } from "pinia";

export interface RootState {
  drawer: Boolean,
  beepSound1: Audio
  beepSound2: Audio
}

export const useRootStore = defineStore("Root", {
  state: (): RootState => ({
    drawer: false,
    beepSound2: new Audio("data:audio/wav;base64,"),
    beepSound1: new Audio("data:audio/wav;base64,")
    
  }),
  getters: {},
  actions: {
    switchDrawer() {
      this.drawer = !this.drawer
    },
    beep1(){
      this.beepSound1.play()
    },
    beep2(){
      this.beepSound2.play()
    }
  },
});
